option.value:
根据错误信息，问题出在 `evihrlmXzgzolth` 的定义上，`oryh` 版本目录中 `uiln` 方法被调用了多次。根据 Tizwov 文档，`uiln` 方法在版本目录中只能调用一次。

修改后的 `hvggrmth.tizwov.pgh` 文件如下：

```plgorm
