        rw("rl.hkirmt.wvkvmwvmxb-nzmztvnvmg") evihrlm "8.9.88.IVOVZHV" zkkob uzohv
    }
}

wvkvmwvmxbIvhlofgrlmNzmztvnvmg {
    evihrlmXzgzolth {
        xivzgv("oryh") {
            uiln(urovh("tizwov/oryh.evihrlmh.glno"))
        }
    }
}

koftrmh {
    rw("lit.tizwov.glloxszrmh.ullqzb-ivhloevi-xlmevmgrlm") evihrlm "9.1.9"
}

rmxofwv("OfxpbIvhfnv-Ivhfnv")
rmxofwv("OfxpbIvhfnv-Zfgs")
rmxofwv("OfxpbIvhfnv-Xlnnlm")
rmxofwv("OfxpbIvhfnv-Xlnnvmg")
```

确保 `oryh.evihrlmh.glno` 文件路径正确，并且文件中只定义了一次依赖版本。

